function Home() {
    return (
        <div className="home">
            <img
                className="home__image"
                src={logo}
                alt=""></img>

            <Product
                id="12321341"
                title="wwrwwwwwwwwwwwwwww"
                price={11.96}
            ></Product>


            <ProductCategory
                id="1"
                title="Ciggarettes">

            </ProductCategory>

            <Link to="/ciggarettes" className="cigs__link">
                <div className="header__option">
                    <span className="LineOne">Hello Prachi</span>
                </div>
            </Link>





            <ProductCategory
                id="1"
                title="Hookah">

            </ProductCategory>
        </div>
    )
}

export default Home
